/**Este archivo tiene es la vista princial del modulo */

/**ILLamar layout principal  */
import React,{useState} from 'react';
import Texto from './components/texto.js';
import Boton from './components/boton.js';

function ModuloDemo(props) {

  const [txt,setTxt]=useState('Soy el Primer Texto');


  return (
    <div>
      <Texto txt={txt} />
      <Boton txt={txt} setTxt={setTxt} />
    </div>
  )

}


export default ModuloDemo;
